import gql from "graphql-tag";
import { ApolloProvider } from "react-apollo";
import { Query, KeystoneProvider } from "@keystonejs/apollo-helpers";

const App = () => (
  <ApolloProvider client={client}>
    <KeystoneProvider>
      <Query
        query={gql`
          query {
            allPosts(first: 10) {
              url
            }
          }
        `}
      >
        {({ data }) => <pre>{JSON.stringify(data)}</pre>}
      </Query>
    </KeystoneProvider>
  </ApolloProvider>
);

export default App;
